import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div id="wrapper">
      <ul>
  <li><a class="active" href="home">Home</a></li>
  <li><a href="About">About</a></li>
  <li><a href="Contact">Contact</a></li>
  <li><a href="News">News</a></li>
</ul>
    </div>
  );
}

export default App;
